#include <functional> #include <unordered_map> // State machine for embedded system class SystemStateMachine { public: enum class State { IDLE, INITIALIZING, RUNNING, ERROR, SHUTDOWN }; enum class Event { START, INIT_COMPLETE, ERROR_OCCURRED, RESET, SHUTDOWN_REQUEST }; private: State current_state; std::unordered_map<std::pair<State, Event>, State> transitions; std::unordered_map<State, std::function<void()>> state_actions; public: SystemStateMachine() : current_state(State::IDLE) { setupTransitions(); setupStateActions(); } void processEvent(Event event) { auto key = std::make_pair(current_state, event); auto it = transitions.find(key); if (it != transitions.end()) { State new_state = it->second; std::cout << "State transition: " << stateToString(current_state) << " -> " << stateToString(new_state) << std::endl; current_state = new_state; executeStateAction(); } else { std::cout << "Invalid transition from " << stateToString(current_state) << " on event " << eventToString(event) << std::endl; } } State getCurrentState() const { return current_state; } private: void setupTransitions() { transitions[{State::IDLE, Event::START}] = State::INITIALIZING; transitions[{State::INITIALIZING, Event::INIT_COMPLETE}] = State::RUNNING; transitions[{State::INITIALIZING, Event::ERROR_OCCURRED}] = State::ERROR; transitions[{State::RUNNING, Event::ERROR_OCCURRED}] = State::ERROR; transitions[{State::RUNNING, Event::SHUTDOWN_REQUEST}] = State::SHUTDOWN; transitions[{State::ERROR, Event::RESET}] = State::IDLE; transitions[{State::SHUTDOWN, Event::START}] = State::INITIALIZING; } void setupStateActions() { state_actions[State::IDLE] = []() { std::cout << "System idle
"; }; state_actions[State::INITIALIZING] = []() { std::cout << "Initializing system...
"; }; state_actions[State::RUNNING] = []() { std::cout << "System running normally
"; }; state_actions[State::ERROR] = []() { std::cout << "System in error state
"; }; state_actions[State::SHUTDOWN] = []() { std::cout << "Shutting down system
"; }; } void executeStateAction() { auto it = state_actions.find(current_state); if (it != state_actions.end()) { it->second(); } } std::string stateToString(State state) const { switch (state) { case State::IDLE: return "IDLE"; case State::INITIALIZING: return "INITIALIZING"; case State::RUNNING: return "RUNNING"; case State::ERROR: return "ERROR"; case State::SHUTDOWN: return "SHUTDOWN"; default: return "UNKNOWN"; } } std::string eventToString(Event event) const { switch (event) { case Event::START: return "START"; case Event::INIT_COMPLETE: return "INIT_COMPLETE"; case Event::ERROR_OCCURRED: return "ERROR_OCCURRED"; case Event::RESET: return "RESET"; case Event::SHUTDOWN_REQUEST: return "SHUTDOWN_REQUEST"; default: return "UNKNOWN"; } } };

