// matrix_multiply.c #include <CL/cl.h> #include <stdio.h> #include <stdlib.h> #include <time.h> #define N 512 #define BLOCK_SIZE 16 int main() { cl_platform_id platform_id = NULL; cl_device_id device_id = NULL; cl_uint ret_num_devices; cl_uint ret_num_platforms; cl_int ret; cl_context context = NULL; cl_command_queue command_queue = NULL; cl_mem memobj_a = NULL; cl_mem memobj_b = NULL; cl_mem memobj_c = NULL; cl_program program = NULL; cl_kernel kernel = NULL; // Allocate matrices float *A = (float*)malloc(sizeof(float) * N * N); float *B = (float*)malloc(sizeof(float) * N * N); float *C = (float*)malloc(sizeof(float) * N * N); // Initialize matrices for (int i = 0; i < N * N; i++) { A[i] = (float)rand() / RAND_MAX; B[i] = (float)rand() / RAND_MAX; C[i] = 0.0f; } // Get platform and device ret = clGetPlatformIDs(1, &platform_id, &ret_num_platforms); ret = clGetDeviceIDs(platform_id, CL_DEVICE_TYPE_GPU, 1, &device_id, &ret_num_devices); // Create context and command queue context = clCreateContext(NULL, 1, &device_id, NULL, NULL, &ret); command_queue = clCreateCommandQueue(context, device_id, 0, &ret); // Create memory buffers memobj_a = clCreateBuffer(context, CL_MEM_READ_ONLY, sizeof(float) * N * N, NULL, &ret); memobj_b = clCreateBuffer(context, CL_MEM_READ_ONLY, sizeof(float) * N * N, NULL, &ret); memobj_c = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(float) * N * N, NULL, &ret); // Copy data to device clEnqueueWriteBuffer(command_queue, memobj_a, CL_TRUE, 0, sizeof(float) * N * N, A, 0, NULL, NULL); clEnqueueWriteBuffer(command_queue, memobj_b, CL_TRUE, 0, sizeof(float) * N * N, B, 0, NULL, NULL); // Optimized matrix multiplication kernel const char *source_str = "__kernel void matrix_multiply(__global const float *A, __global const float *B, __global float *C, const int N) {
" " int row = get_global_id(0);
" " int col = get_global_id(1);
" " 
" " if (row < N && col < N) {
" " float sum = 0.0f;
" " for (int k = 0; k < N; k++) {
" " sum += A[row * N + k] * B[k * N + col];
" " }
" " C[row * N + col] = sum;
" " }
" "}
"; // Create and build program program = clCreateProgramWithSource(context, 1, &source_str, NULL, &ret); ret = clBuildProgram(program, 1, &device_id, NULL, NULL, NULL); // Create kernel kernel = clCreateKernel(program, "matrix_multiply", &ret); // Set kernel arguments clSetKernelArg(kernel, 0, sizeof(cl_mem), (void*)&memobj_a); clSetKernelArg(kernel, 1, sizeof(cl_mem), (void*)&memobj_b); clSetKernelArg(kernel, 2, sizeof(cl_mem), (void*)&memobj_c); clSetKernelArg(kernel, 3, sizeof(int), (void*)&N); // Execute kernel size_t global_work_size[2] = {N, N}; size_t local_work_size[2] = {BLOCK_SIZE, BLOCK_SIZE}; clock_t start = clock(); ret = clEnqueueNDRangeKernel(command_queue, kernel, 2, NULL, global_work_size, local_work_size, 0, NULL, NULL); clFinish(command_queue); clock_t end = clock(); // Read result clEnqueueReadBuffer(command_queue, memobj_c, CL_TRUE, 0, sizeof(float) * N * N, C, 0, NULL, NULL); double time_taken = ((double)(end - start)) / CLOCKS_PER_SEC; printf("Matrix multiplication completed in %.4f seconds
", time_taken); // Verify result (check first few elements) printf("First 3x3 result:
"); for (int i = 0; i < 3; i++) { for (int j = 0; j < 3; j++) { printf("%.2f ", C[i * N + j]); } printf("
"); } // Cleanup clReleaseKernel(kernel); clReleaseProgram(program); clReleaseMemObject(memobj_a); clReleaseMemObject(memobj_b); clReleaseMemObject(memobj_c); clReleaseCommandQueue(command_queue); clReleaseContext(context); free(A); free(B); free(C); return 0; }

// image_filter.c #include <CL/cl.h> #include <stdio.h> #include <stdlib.h> #include <string.h> #define WIDTH 1024 #define HEIGHT 1024 int main() { cl_platform_id platform_id = NULL; cl_device_id device_id = NULL; cl_uint ret_num_devices; cl_uint ret_num_platforms; cl_int ret; cl_context context = NULL; cl_command_queue command_queue = NULL; cl_mem memobj_input = NULL; cl_mem memobj_output = NULL; cl_program program = NULL; cl_kernel kernel = NULL; // Allocate image data unsigned char *input_image = (unsigned char*)malloc(sizeof(unsigned char) * WIDTH * HEIGHT); unsigned char *output_image = (unsigned char*)malloc(sizeof(unsigned char) * WIDTH * HEIGHT); // Initialize input image with test pattern for (int i = 0; i < WIDTH * HEIGHT; i++) { input_image[i] = (unsigned char)(i % 256); } // Get platform and device ret = clGetPlatformIDs(1, &platform_id, &ret_num_platforms); ret = clGetDeviceIDs(platform_id, CL_DEVICE_TYPE_GPU, 1, &device_id, &ret_num_devices); // Create context and command queue context = clCreateContext(NULL, 1, &device_id, NULL, NULL, &ret); command_queue = clCreateCommandQueue(context, device_id, 0, &ret); // Create memory buffers memobj_input = clCreateBuffer(context, CL_MEM_READ_ONLY, sizeof(unsigned char) * WIDTH * HEIGHT, NULL, &ret); memobj_output = clCreateBuffer(context, CL_MEM_WRITE_ONLY, sizeof(unsigned char) * WIDTH * HEIGHT, NULL, &ret); // Copy input data to device clEnqueueWriteBuffer(command_queue, memobj_input, CL_TRUE, 0, sizeof(unsigned char) * WIDTH * HEIGHT, input_image, 0, NULL, NULL); // Sobel edge detection kernel const char *source_str = "__kernel void sobel_filter(__global const unsigned char *input, __global unsigned char *output, const int width, const int height) {
" " int x = get_global_id(0);
" " int y = get_global_id(1);
" " 
" " if (x > 0 && x < width - 1 && y > 0 && y < height - 1) {
" " // Sobel X kernel
" " int gx = -input[(y-1)*width + (x-1)] + input[(y-1)*width + (x+1)]
" " - 2*input[y*width + (x-1)] + 2*input[y*width + (x+1)]
" " - input[(y+1)*width + (x-1)] + input[(y+1)*width + (x+1)];
" " 
" " // Sobel Y kernel
" " int gy = -input[(y-1)*width + (x-1)] - 2*input[(y-1)*width + x] - input[(y-1)*width + (x+1)]
" " + input[(y+1)*width + (x-1)] + 2*input[(y+1)*width + x] + input[(y+1)*width + (x+1)];
" " 
" " // Calculate magnitude
" " int magnitude = (int)sqrt((float)(gx*gx + gy*gy));
" " 
" " // Clamp to 0-255 range
" " output[y*width + x] = (unsigned char)min(255, max(0, magnitude));
" " } else {
" " output[y*width + x] = 0;
" " }
" "}
"; // Create and build program program = clCreateProgramWithSource(context, 1, &source_str, NULL, &ret); ret = clBuildProgram(program, 1, &device_id, NULL, NULL, NULL); // Create kernel kernel = clCreateKernel(program, "sobel_filter", &ret); // Set kernel arguments clSetKernelArg(kernel, 0, sizeof(cl_mem), (void*)&memobj_input); clSetKernelArg(kernel, 1, sizeof(cl_mem), (void*)&memobj_output); clSetKernelArg(kernel, 2, sizeof(int), (void*)&WIDTH); clSetKernelArg(kernel, 3, sizeof(int), (void*)&HEIGHT); // Execute kernel size_t global_work_size[2] = {WIDTH, HEIGHT}; size_t local_work_size[2] = {16, 16}; ret = clEnqueueNDRangeKernel(command_queue, kernel, 2, NULL, global_work_size, local_work_size, 0, NULL, NULL); clFinish(command_queue); // Read result clEnqueueReadBuffer(command_queue, memobj_output, CL_TRUE, 0, sizeof(unsigned char) * WIDTH * HEIGHT, output_image, 0, NULL, NULL); printf("Sobel edge detection completed!
"); printf("First 10x10 output pixels:
"); for (int i = 0; i < 10; i++) { for (int j = 0; j < 10; j++) { printf("%3d ", output_image[i * WIDTH + j]); } printf("
"); } // Cleanup clReleaseKernel(kernel); clReleaseProgram(program); clReleaseMemObject(memobj_input); clReleaseMemObject(memobj_output); clReleaseCommandQueue(command_queue); clReleaseContext(context); free(input_image); free(output_image); return 0; }

