// Optimized kernel for coalesced memory access const char *optimized_kernel = "__kernel void optimized_add(__global const float *a, __global const float *b, __global float *c) {
" " int i = get_global_id(0);
" " int local_i = get_local_id(0);
" " int group_size = get_local_size(0);
" " 
" " // Use local memory for better performance
" " __local float local_a[256];
" " __local float local_b[256];
" " 
" " // Load data to local memory
" " local_a[local_i] = a[i];
" " local_b[local_i] = b[i];
" " 
" " // Synchronize work items in work group
" " barrier(CLK_LOCAL_MEM_FENCE);
" " 
" " // Perform computation
" " c[i] = local_a[local_i] + local_b[local_i];
" "}
